import React from 'react';
import NavbarOption from './navbar';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import "./userportal.css"; 
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';
import axios from 'axios';
import { useEffect, useState } from 'react';

const style = {
  width: '100%',
  maxWidth: 1250,
  bgcolor: 'background.paper',
};





function Userportalpage() {
  useEffect(() => {
    axios.get('http://127.0.0.1:8000/myapp/category-options', {
    })
      .then(res => {
        // console.log(res.data)
        setCategoryOptions(res.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="user-portal-page">
      <NavbarOption />
      <div className="button-container">
        <List sx={style} component="nav" aria-label="mailbox folders">
      <ListItem button>
        <ListItemText primary="All" />
      </ListItem>
      <ListItem button>
        <ListItemText primary="Toys" />
      </ListItem>
      <ListItem button>
        <ListItemText primary="Food & Related" />
      </ListItem>
      <ListItem button>
        <ListItemText primary="Sleep" />
      </ListItem>
      <ListItem button>
        <ListItemText primary="Clothing" />
      </ListItem>
      <ListItem button>
        <ListItemText primary="Strap" />
      </ListItem>
      <ListItem button>
        <ListItemText primary="Cages" />
      </ListItem>
    </List>
      </div>  
    </div>
  );
}

export default Userportalpage;




